// PokeDetail.js
import React from "react";

const PokeDetail = ({ pokemon }) => {
  return (
    <div>
      <h1>{pokemon.name}</h1>
      {pokemon.sprites && (
        <img src={pokemon.sprites.front_default} alt={pokemon.name} />
      )}
      {/* Agrega más detalles según lo necesario */}
    </div>
  );
};

export default PokeDetail;
